import React, { useState } from 'react';
import {
  Box,
  Card,
  CardContent,
  CardMedia,
  Typography,
  TextField,
  Button,
  Grid,
  CircularProgress,
  Snackbar,
  Alert,
} from '@mui/material';
import { motion } from 'framer-motion';
import WbSunnyIcon from '@mui/icons-material/WbSunny';
import LocationOnIcon from '@mui/icons-material/LocationOn';
import axios from '../axiosConfig';

const WeatherRecommendations = () => {
  const [location, setLocation] = useState('');
  const [recommendation, setRecommendation] = useState(null);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState(null);

  const getRecommendation = async () => {
    if (!location) return;

    setLoading(true);
    setError(null);

    try {
      const response = await axios.get(`/api/recommendations/weather?location=${encodeURIComponent(location)}`);
      setRecommendation(response.data);
    } catch (err) {
      setError('Could not get outfit recommendations. Please try again.');
      console.error('Error fetching recommendations:', err);
    } finally {
      setLoading(false);
    }
  };

  return (
    <Box sx={{ py: 4 }}>
      <Typography variant="h4" sx={{ mb: 3, color: '#FF69B4', textAlign: 'center' }}>
        Weather-Based Outfit Recommendations
      </Typography>

      {/* Location Input */}
      <Box sx={{ display: 'flex', gap: 2, mb: 4, justifyContent: 'center' }}>
        <TextField
          value={location}
          onChange={(e) => setLocation(e.target.value)}
          placeholder="Enter your location"
          variant="outlined"
          InputProps={{
            startAdornment: <LocationOnIcon sx={{ color: '#FF69B4', mr: 1 }} />,
          }}
          sx={{
            '& .MuiOutlinedInput-root': {
              '&.Mui-focused fieldset': {
                borderColor: '#FF69B4',
              },
            },
          }}
        />
        <Button
          onClick={getRecommendation}
          disabled={!location || loading}
          variant="contained"
          sx={{
            background: 'linear-gradient(45deg, #FF69B4 30%, #FFB6C1 90%)',
            color: 'white',
            '&:hover': {
              background: 'linear-gradient(45deg, #FF1493 30%, #FF69B4 90%)',
            },
          }}
        >
          Get Outfit
        </Button>
      </Box>

      {/* Loading State */}
      {loading && (
        <Box sx={{ display: 'flex', justifyContent: 'center', my: 4 }}>
          <CircularProgress sx={{ color: '#FF69B4' }} />
        </Box>
      )}

      {/* Recommendation Display */}
      {recommendation && !loading && (
        <motion.div
          initial={{ opacity: 0, y: 20 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.5 }}
        >
          {/* Weather Info */}
          <Card sx={{ mb: 4, background: 'linear-gradient(45deg, #FF69B4 30%, #FFB6C1 90%)', color: 'white' }}>
            <CardContent>
              <Box sx={{ display: 'flex', alignItems: 'center', gap: 2 }}>
                <WbSunnyIcon />
                <Typography variant="h6">
                  {recommendation.weatherInfo.condition} • {Math.round(recommendation.weatherInfo.temperature)}°C
                </Typography>
              </Box>
              <Typography variant="body1" sx={{ mt: 1, fontStyle: 'italic' }}>
                {recommendation.quip}
              </Typography>
            </CardContent>
          </Card>

          {/* Outfit Recommendations */}
          <Grid container spacing={3}>
            {Object.entries(recommendation.outfit).map(([category, item]) => (
              item && (
                <Grid item xs={12} sm={6} md={3} key={category}>
                  <motion.div whileHover={{ scale: 1.05 }} transition={{ duration: 0.2 }}>
                    <Card sx={{ height: '100%' }}>
                      {item.imageUrl && (
                        <CardMedia
                          component="img"
                          height="200"
                          image={item.imageUrl}
                          alt={item.name}
                          sx={{ objectFit: 'cover' }}
                        />
                      )}
                      <CardContent>
                        <Typography variant="h6" sx={{ color: '#FF69B4' }}>
                          {category}
                        </Typography>
                        <Typography variant="body1">{item.name}</Typography>
                      </CardContent>
                    </Card>
                  </motion.div>
                </Grid>
              )
            ))}
          </Grid>
        </motion.div>
      )}

      {/* Error Snackbar */}
      <Snackbar open={!!error} autoHideDuration={6000} onClose={() => setError(null)}>
        <Alert onClose={() => setError(null)} severity="error" sx={{ width: '100%' }}>
          {error}
        </Alert>
      </Snackbar>
    </Box>
  );
};

export default WeatherRecommendations;
